import React from 'react';
import './GalleryPage.css'; 
import image1 from '../images/image11.jpg'; 
import image2 from '../images/image21.jpg'; 
import image3 from '../images/image27.jpg'; 
import image4 from '../images/image13.jpg'; 
import image5 from '../images/image24.jpg'; 
import image6 from '../images/image12.jpg'; 
import image7 from '../images/image16.jpg'; 
import image8 from '../images/image32.jpg'; 
import image9 from '../images/image9.jpg'; 
import image10 from '../images/image10.jpg'; 


const GalleryPage = () => {
  // Array of image URLs
  const images = [image1, image2, image3,image4, image5,image12, image16, image32, image9, image10]; // Add more images to the array

  return (
    <section id="gallery" className="pic-gallery">
      <div className="pic-container">
        <h2>Photo Gallery</h2>
        <div className="pic-gallery-grid">
          {images.map((image, index) => (
            <div key={index} className="pic-gallery-item">
              <img src={image} alt={`Photo ${index + 1}`} />
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default GalleryPage;
